import React, { createContext, useEffect, useState } from "react";
import { Route, Routes } from "react-router-dom";
import Header from "./components/header/header";
import Footer from "./components/footer/footer";
import Components from "./views/components/components";
import SurveyGender from "./components/SurveyGender";
import SurveyBirthYear from "./components/SurveyBirthYear";
import SurveyInterest from "./components/SurveyInterest";
import SurveyResult from "./components/SurveyResult";
import Main from "./components/Main";
import Mypage from "./components/Mypage";
import WishList from "./components/WishList";
import Preview from "./components/Preview";
import SurveyContext from "./SurveyContext";

function App() {
  const [gender, setGender] = useState("man");
  const [birth, setBirth] = useState(1990);
  const [interest, setInterest] = useState([]);

  return (
    <div>
      <Header />
      <Routes>
        <Route path="/haru" element={<Preview />} />
        <Route
          path="/haru/survey"
          element={
            <SurveyContext.Provider value={{ gender, setGender }}>
              <SurveyGender />
            </SurveyContext.Provider>
          }
        />
        <Route
          path="/haru/survey/1"
          element={
            <SurveyContext.Provider value={{ birth, setBirth }}>
              <SurveyBirthYear />
            </SurveyContext.Provider>
          }
        />
        <Route
          path="/haru/survey/2"
          element={
            <SurveyContext.Provider value={{ value }}>
              <SurveyInterest />
            </SurveyContext.Provider>
          }
        />
        <Route
          path="/haru/survey/result"
          element={
            <SurveyContext.Provider value={{ gender, birth, interest }}>
              <SurveyResult />
            </SurveyContext.Provider>
          }
        />
        <Route path="/haru/main" element={<Main />} />
        <Route path="/haru/mypage" element={<Mypage />} />
        <Route path="/haru/wishlist" element={<WishList />} />
      </Routes>
      <Footer />
    </div>
  );
}

export default App;
